import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className="app-wrapper">
      <header>
        <img src="https://www.osii.com/images/cat-headers/banner-solutions-initiatives-smartgrid.jpg"></img> </header>
      <nav>
        <div>
          Profile
         </div>
      </nav>
      <div>Massage</div>
      <div> Main content</div>
    </div>
  )

} 



export default App;
